package cmd

import (
	"github.com/Lanly109/lan/utils"
	log "github.com/sirupsen/logrus"
	"github.com/spf13/cobra"
)

var htmlName string

const countDownHtml string = `<!doctype html>
<html>

<head>

	<script type="text/javascript">
		var StartTime = new Date('2024/09/07 08:00:00') // please change it
		var EndTime = new Date('2024/09/07 12:30:00') // please change it
		var password = "<++>"    // zip
		var password2 = "<++>"   // pdf
		var attation = "开始前请勿触碰鼠标键盘！"   

		var totleTime = EndTime.getTime() - StartTime.getTime()
	</script>

	<meta charset="utf-8">
	<style type="text/css">
		#CountMsg {
            font-family: number;
			font-size: 150px;
			text-align: center;
			color: yellow;
            display: block;
		}

        #container {
          display: flex;
          flex-direction: column;
          align-items: center;
          justify-content: center;
          height: 100vh;
        }

		#password, #attation {
            margin-bottom: 20px;
			font-size: 60px;
			text-align: center;
			color: yellow;
			line-height: 2;
			font-family: Consolas, Tahoma;
		}

		body {
			background: black;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
		}
        html {
            height: 100%;
        }

	</style>
</head>

<body>

    <div id="container">

    <div id="password">解压密码：<span id="hiden" ></span></div>
    <div id="password">pdf密码：<span id="hiden2" ></span></div>
    <div id="attation"> </div>

		<div id="CountMsg" class="HotData">
			<span id="sign"></span><span id="t_h">00</span><span>:</span><span id="t_m">00</span><span>:</span><span id="t_s">00</span>
		</div>
        <!-- <div> -->
		<!--     <meter id="meter" min="0" max=1000 value="100" high="9" low="4" optimum="1"> -->
		<!-- </div> -->

    </div>
</body>

<script type="text/javascript">
	<!-- document.getElementById("meter").max = totleTime; -->

	function getRTime() {

		var NowTime = new Date();
		var t = EndTime.getTime() - NowTime.getTime();
		var ss = NowTime.getTime() - StartTime.getTime();
		if (ss < 0){
			<!-- document.getElementById("info").innerText = "距离比赛开始还有";	 -->
			t = -ss
		}else if (t < 0){
			<!-- document.getElementById("info").innerText = "比赛结束!";	 -->
			t = 0
		}else {
			<!-- document.getElementById("info").innerText = "距离比赛结束还有";	 -->
		}

		if (ss < -60 * 1000){
			attation = "请勿触碰鼠标键盘！"   
		} else if (-60 * 1000 <= ss && ss < 0){
			attation = "比赛即将开始！"
		} else if (ss >= 0 && ss <= t){
			attation = "比赛开始！"
		} else if (ss >= t && t >= 1 * 60 * 1000){
			attation = "比赛已过半！"
		} else if (t <= 1 * 60 * 1000 && t > 0){
			attation = "比赛即将结束！"
		} else if (t <= 0){
			attation = "比赛结束！"
		}

		document.getElementById("attation").innerText = attation;
        if (ss >= 0){
			document.getElementById("hiden").innerText = password
			document.getElementById("hiden2").innerText = password2
        }

        if (false && ss >= 0 && ss * 2 <= totleTime){
            document.getElementById("sign").innerText = '+';
            t = ss;
        }else{
            document.getElementById("sign").innerText = '-';
        }

		var h = Math.floor(t / 1000 / 60 / 60 % 24);
		if (h < 10) h = "0" + h;
		var m = Math.floor(t / 1000 / 60 % 60);
		if (m < 10) m = "0" + m;
		var s = Math.floor(t / 1000 % 60);
		if (s < 10) s = "0" + s;
		<!-- var ms = Math.floor(t % 1000); -->
		<!-- if (ms < 10) ms = "0" + "0" + ms; -->
		<!-- else if (ms < 100) ms = "0" + ms; -->

		var gone = totleTime - t;

        if (ss < 0){
			gone = 0
            document.getElementById("sign").innerText = '-';
        }

		document.getElementById("t_h").innerText = h;
		document.getElementById("t_m").innerText = m;
		document.getElementById("t_s").innerText = s;
		<!-- document.getElementById("t_ms").innerText = ms; -->
		<!-- document.getElementById("meter").value = gone; -->
	}

	setInterval(getRTime, 0);
</script>


	<style type="text/css">
        @font-face {
          font-family: Consolas;
		  src: url(data:font/truetype;base64,);
		}
        @font-face {
          font-family: number;
          src: url(data:font/truetype;base64,);
        }

	</style>

</html>
`

// countDownCmd represents the countdown command
var countDownCmd = &cobra.Command{
	Use:   "countdown",
	Short: "Generate html that is the countdown of a contest",
	Long:  `A html source code will be generated that is the countdown of a contest.`,
	Run: func(cmd *cobra.Command, args []string) {
		log.Debugf("filename: %s", htmlName)
		if utils.FileExist(htmlName) {
			log.Errorf("The File %s Exists!", htmlName)
			return
		}
		err := utils.WriteFile(htmlName, countDownHtml)
		if err != nil {
			log.Error(err)
		} else {
			log.Infof("Successfully generated sharing script [%s]", htmlName)
		}
	},
}

func init() {
	genCmd.AddCommand(countDownCmd)

	countDownCmd.Flags().StringVarP(&htmlName, "name", "n", "countdown.html", "The countdown html name(default countdown.html)")
}
